import React from 'react';

function Persona(props) {
    let nombre = props.name;
    let edad = props.age;
    let mayor;
    if (edad>17) {
        mayor = <p>Invitar a tomar algo</p>
    }else{
        mayor = <p>No tiene edad legal para tomar alcohol</p>
    };


  return(
    <div>
        <p>{nombre}</p>
        {mayor}
    </div>
  )
}

  export default Persona;
